@-moz-document domain("putlocker.co") {
/* last Update - April 26th */
/* --------------------==≡≡[ Font ]≡≡==----------------------------------- */

/* latin-ext */
@font-face {
  font-family: 'Open Sans';
  font-style: normal;
  font-weight: 400;
  src: local('Open Sans'), local('OpenSans'), url(https://fonts.gstatic.com/s/opensans/v13/u-WUoqrET9fUeobQW7jkRRJtnKITppOI_IvcXXDNrsc.woff2) format('woff2');
  unicode-range: U+0100-024F, U+1E00-1EFF, U+20A0-20AB, U+20AD-20CF, U+2C60-2C7F, U+A720-A7FF;
}
/* latin */
@font-face {
  font-family: 'Open Sans';
  font-style: normal;
  font-weight: 400;
  src: local('Open Sans'), local('OpenSans'), url(https://fonts.gstatic.com/s/opensans/v13/cJZKeOuBrn4kERxqtaUH3VtXRa8TVwTICgirnJhmVJw.woff2) format('woff2');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2212, U+2215, U+E0FF, U+EFFD, U+F000;
}

* {
    font-family: 'Open Sans', sans-serif;
}

/* --------------------==≡≡[ Background ]≡≡==----------------------------------- */

body {
    background-image: url("data:image/png;base64,") !important;
    background-repeat: repeat !important;
    background-color: #181818 !important;
    color: #fff;
}

/* --------------------==≡≡[ Search bar + Text input + Dropdown menus ]≡≡==----------------------------------- */

#search {
    float: right;
    margin: 38px -3px 0;
    position: inherit;
    width: inherit;
}

#search input[type="text"] {
    height: 16px !important;
    width: 225px !important;
    font-size: 12px !important;
    padding: 9px !important;
    color: #fff !important;
    background-color: #0e0e0e !important;
    border-radius: 4px 0px 0px 4px;
    border-color: #1c1c1c #0e0e0e #1c1c1c #1c1c1c !important;
}

#search input[type="submit"] {
    border-color: #1c1c1c !important;
    height: 36px !important;
    width: 90px !important;
    font-size: 12px !important;
    padding: 10px !important;
    background-color: #090909 !important;
    color: #FFF !important;
    display: inline-block !important;
    line-height: 8px !important;
    margin: 0 0 0 -4px !important;
 	outline: none;
	cursor: pointer;
}

#search input[type="submit"]:hover {
	background-color: #1c1c1c !important;
}

input[type="text"], textarea { /*Search Boxes - Home Page*/
    border-color: #1c1c1c;
    background-color: #0e0e0e;
    width: 350px;
    border-radius: 4px;
    color: #fff;
    padding: 6px 5px;
}

input[type="text"]:focus, textarea:focus {
  	outline: none;
    
}

select { /* Dropdown menu */
    border-radius: 4px;
    padding:5px 8px;
    color: #fff;
    outline: none;
    border-color: #1c1c1c;
    background-color: #0e0e0e;
}

select:hover {
    background-color: #1c1c1c;
}

/* --------------------==≡≡[ Scrollbar ]≡≡==----------------------------------- */

::-webkit-scrollbar {
    width: 12px;
}

::-webkit-scrollbar-thumb {
    border-radius: 2px;
    -webkit-box-shadow: 0 0 8px rgba(0,0,0,.8);
    background: #1c1c1c;
    border: 1px solid #232323;
}

::-webkit-scrollbar-track { /*background*/
    background: #0e0e0e;
}

/* --------------------==≡≡[ Navigation bar ]≡≡==----------------------------------- */
    
#nav {
    background: #151515 !important;
    box-sizing: border-box;
    width: 740px;
    height: 37px;
    border: 1px solid #1c1c1c !important;
    padding: 0;
    box-shadow: 0px 0px 8px 0px #000 !important;
}

/* Nav bar font size */
#nav li {
    font-size: 13px;
    margin-right: 0 !important;
}

#nav li:hover>a {
    background: #1c1c1c;
}

#nav .dropdown,#nav .dropdown2 {
    position: absolute;
    z-index: 999;
    top: 33px;
    left: 0;
    background-color: #1c1c1c; /* this */
    border-color: #333333 !important;
    box-shadow: 0px 0px 8px 0px #000 !important;
}

#nav .dropdown {
    width: 330px;
}

#nav .dropdown2 {
    width: 154px;
}

#nav .dropdown2 a {
    width: 120px;
}

#nav .dropdown ul li,#nav .dropdown2 ul li {
    text-align: center !important;
    background: none !important;
    padding: 0 !important;
}

#nav .dropdown2 .col1 {
    margin: 0;
}

/* #nav button size */
#nav li a {
    padding: 0 17px !important;
    color: white !important;
    height: 35px;
    padding-left: 12.9px !important;
	padding-right: 12.9px !important; /*come back*/
}

#nav li a:hover {
    background-color: #1c1c1c !important;
    background: #1c1c1c !important;
    color: #81d63f !important;
}

#nav .dropdown .col1,#nav .dropdown .col1+.col1+.col1 {
    margin: 0;
    width: 110px;
}

#nav .dropdown .col1 ul li a, #nav .dropdown2 .col1 ul li a {
    font-size: 13px;
}

/* --------------------==≡≡[ "Search" button ]≡≡==----------------------------------- */

.submit_form_button { /* Homepage's "Search" button */
    border-color: #1c1c1c;
    background-color: #0e0e0e;
    border-radius: 4px;
    color: #fff;
    padding: 10px 18px;
    font-weight: normal;
	cursor: pointer;
    text-transform: uppercase;
    letter-spacing: 1px;
    position: relative;
    /*Shadow*/
	-webkit-box-shadow: 0px 6px 0px rgba(0, 0, 0, 0.8);
	-moz-box-shadow: 0px 6px 0px rgba(0, 0, 0, 0.8);
	box-shadow: 0px 6px 0px rgba(0, 0, 0, 0.8);
}

.submit_form_button:hover {
    background-color: #1c1c1c;
    top: 2px;
	/*Shadow*/
	-webkit-box-shadow: 0px 4px 0px rgba(0, 0, 0, 0.4);
	-moz-box-shadow: 0px 4px 0px rgba(0, 0, 0, 0.4);
 	box-shadow: 0px 4px 0px rgba(0, 0, 0, 0.4);
}

.submit_form_button:active {
    top: 5px;
    /*Shadow*/
	-webkit-box-shadow: 0px 1px 0px rgba(0, 0, 0, 0.4);
	-moz-box-shadow: 0px 1px 0px rgba(0, 0, 0, 0.4);
	box-shadow: 0px 1px 0px rgba(0, 0, 0, 0.4);
}

.submit_form_button:focus {
    outline: none;
}

/* --------------------==≡≡[ Video player (testing area) 
]≡≡==----------------------------------- */

/* Synopsis text padding */
td[style="padding-left:5px;padding-top:10px;"] {
    padding-right: 5px;
}

/* Video summary titles */
.content-box tbody>tr>td>strong {
    font-size: 100%;
}

/* padding above IMDB Rating */
.content-box td.summary{
    padding-top: 10px;
}

/* Centers video player */
div[class="video"] {
    margin-left: 5px;
    margin-right: 5px;
}

/* --------------------==≡≡[ Content box? ]≡≡==----------------------------------- */

/* general font colour, was #777 */
.content-box {
    color: #888 !important;
    background-color: #151515 !important;
    border-color:  #1c1c1c  !important;
    text-shadow: 0 0 2px #000 !important;
    box-shadow: 0px 0px 8px 0px rgba(0,0,0,1) !important;
    width: 738px;
}

h1, h2, td.entry, td.entry2 {
    border-top: 0 !important;
    color: #5bb515 !important;
    /*box-shadow: 0 2px 0 #000;*/
}

td[style="padding-top:13.5px;padding-bottom:13.5px;"] { /* space under video summary */
    padding: 3px !important;
}

/* --------------------==≡≡[ Images (content box) ]≡≡==----------------------------------- */

.content-box img {
    border-color: #1c1c1c  !important;
    -webkit-transition: all .15s !important;
        /* Safari */
    transition: all .15s !important;
    transition-timing-function: linear !important;
}

.content-box img:hover {
    border-color: #5bb515 !important;
    -webkit-transition: all .15s !important;
        /* Safari */
    transition: all .15s !important;
    transition-timing-function: linear !important;
}

td[class="summary"]:nth-child(1) :hover { /* remove highlight from summary image (mouseover). Explanation -> Under td[class="summary"], it's the first td (child) */
    border-color: #1c1c1c !important;
}

/* --------------------==≡≡[ Links/text ]≡≡==----------------------------------- */

label {
    padding-right: 15px;
}

input {
    position: relative;
}

[type="radio"], [type="checkbox"], label {
    top: 2px;
    cursor: pointer;
}

.form_info, label { /* Home page font */
	font-size: 14.4px;
}

td>table { /* Homepage checkbox text*/
    font-size: 90%;
}

p { /*seems to only be on the "Contact Us/Report Broken" page */
    font-size: 12px;
    margin-left: 11px;
    margin-top: 8px;
    margin-bottom: 0;
}

strong {
	text-align: center;
}

.content-box h1 strong font{
    color:#5bb515;
    font-size: 70%;
    text-transform: none;
    text-align: right !important;
}

.content-box h1 {
    background-color: #1c1c1c !important;
    /* border: 0; */
    text-align: center;
    padding: 0px 10px 5px 10px;
    border-bottom: 1px solid rgba(0,0,0,.5);
    font-size: 19px;
}

.content-box h2 {
    background-color: #1c1c1c !important;
    border: 0;
    border-bottom: 1px solid rgba(0,0,0,.5);
    font-size: 75%;
}

h2 strong {
    color: #5bb515;
}

/* "Video keeps buffering?" text */
.content-box>div.message {
    text-align: center;
    background: #181818 !important;
    padding: 5px 10px;
    margin: 10px 0 0;
    font-size: 80%;
}

h2[style="color:black;margin-bottom:0px !important;margin-top:0px !important;padding:5px;background-color:beige;color:green;"], [style="color:gray;margin-bottom:0px !important;margin-top:0px !important;padding:5px;background-color:beige;color:green;"], [style="color:black;margin-bottom:0px !important;padding:5px;background-color:beige;color:green;"], [style="color:black;margin-bottom:0px !important;border-top:1px solid silver;padding:5px;background-color:beige;color:green;"], [style="color:green;margin-bottom:0px !important;border-top:1px solid silver;padding:5px;background-color:beige;"], [style="color:black;margin-bottom:0px !important;border-top:1px solid silver;padding:5px;background-color:beige;color:green"] {
   text-align: center !important;
}

/* "Sorry, there is no movie directed by" */
div[style="text-align:left;padding:10px;font-family:arial;font-size:12px;color:black;"] {
    color: #888 !important;
}

.content-box>div { /* A - B - C - D bar */
    background-color: transparent !important;
    border-bottom: transparent !important;
    margin-top: 10px;
    margin-bottom: 10px;
}

.content-box>table>tbody>tr>td { /* page numbers */
    border-color: transparent !important;
    background-color: transparent !important;
}

a[style="color:#000000;text-decoration:none;"] {
    color: #888 !important;
}

td.form_info, label.form_info {
    color: #888 !important;
}

/* unvisited link */
a:link {
    color: #c6c6c6;
}

/* visited link */
a:visited {
    color: #c6c6c6;
}

/* mouse over link */
a:hover {
    color: #f4f4f4;
}

/* selected link */
a:active {
    color: #f4f4f4;
}

a.addthis_button_expanded { /* share button text */
    text-shadow: none;
}

.content-box h2[style="padding:0px;margin:0px;display:inline;font-weight:normal;border:0px;font-size:12px;"] { /* background behind h2 links */
    background-color: transparent !important;
}

/* --------------------==≡≡[ Widgets ]≡≡==----------------------------------- */

/* Like/Share button frame */
.addthis_toolbox.addthis_default_style {
    margin-left: auto;
    margin-right: auto;
    width: 320px;
}

/* Google plusone (share button) */
a.addthis_button_google_plusone.at300b {
    width: 60px;
}

/* Facebook comments background */
.fb-comments.fb_iframe_widget {
    background-color: #fff !important;
    margin-bottom: 20px;
    margin-left: 5px;
    border-radius: 3px;
}

/* --------------------==≡≡[ Removed content ]≡≡==----------------------------------- */

/* Like us on Facebook */	.menu-box, .fb-like-box,
/* "Sponsored Content" */	h2[style="color: green; border-top-width: 1px; border-top-style: solid; border-top-color: silver; padding: 5px; margin-bottom: 0px !important; display: block; background-color: beige;"],
/* footer */					.footer-box, table.footer, a.movgr,
/* Random block */			td[valign="top"][style="padding-left:5px;"]	{
    display: none !important;
}

/* --------------------==≡≡[ Custom Images ]≡≡==----------------------------------- */

/* Custom "Play Video" button */
td.entry2 img {
    border: 1px solid rgba(255,255,255,.1) !important;
    border-radius: 8px !important;
   /* box-shadow: 0 1px 2px #111,0 1px 0 #555 inset !important; */
    -webkit-transition: border-radius .2s,background .2s !important;
	/* Safari */
    transition: border-radius .2s,background .2s !important;
    transition-timing-function: linear !important;
}


td.entry2 img:hover {
    /*box-shadow: inset 0 2px 4px 0 #000 !important;*/
   	border: 1px solid rgba(255,255,255,.1) !important;
    background-color: #1c1c1c !important;
    border-radius: 3px !important;
    -webkit-transition: border-radius .2s,background .2s !important;
        /* Safari */
    transition: border-radius .2s,background .2s !important;
    transition-timing-function: linear !important;
    background-image: url(data:image/png;base64,);
}

img[src*="http://image4.putlocker.co/images/play_video.gif"] {
    width: 0;
    height: 20px;
    padding-right: 85px;
    background-image: url(data:image/png;base64,);
}


/* --------------------==≡≡[ My Custom dot points ]≡≡==----------------------------------- */

img[src*="http://putlocker.co/images/arrow.gif"], img[src*="http://image4.putlocker.co/images/bullet.gif"], img[src*="http://putlocker.co/images/bullet.gif"]{
    width: 0;
    height: 8px;
    padding-right: 8px;
    background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAgAAAAICAYAAADED76LAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAGVJREFUeNpi8PT0mgDEAf///2fAhpkYGBgMgHi9l5f3ASAGsVEAExLbHojPAxUtAGIBbApgIB6IHwAVNeBSAAL8IKtBJrFgkbwIxAXbtm09AOIgK/gIlViAzZGNQKyALgkCAAEGAGkTKxTHi08bAAAAAElFTkSuQmCC);
}


/* --------------------==≡≡[ My Custom Logo ]≡≡==----------------------------------- */

td.mainlogo img {
    visibility: hidden;
}

td.mainlogo {
    background-color: transparent;
    border: 0;
    padding: 0;
}

td.mainlogo a {
    height: 90px;
    background-repeat: no-repeat;
    display: inline-block;
    background-image: url(data:image/png;base64,);
}
}

@-moz-document url("https://putlocker.co/"), url("http://putlocker.co/") {
/* --------------------==≡≡[ Home Page specific ]≡≡==----------------------------------- */

h2[style="color:green;margin-bottom:0px !important;border-top:1px solid silver;padding:5px;background-color:beige;"] {
    display: none;
}
}
